import React from "react";

import { connect } from "react-redux";

const ReceiptList = ({ receipts }) => {
  //   const receiptNodes = receipts.map((receipt) => (
  //     <Receipt
  //       key={(receipt.id = Math.random().toString())}
  //       name={receipt.name}
  //       source={receipt.source}
  //       time={receipt.time}
  //       instructions={receipt.instructions}
  //     />
  //   ));
  console.log("something");
  console.log(receipts);
  return (
    <div>
      <table>
        <thead>
          <tr>
            <th>Receipt Name</th>
            <th>Receipt Source</th>
            <th>Receipt Time</th>
            <th>Preparation Instructions</th>
          </tr>
        </thead>
        <tbody>
          {receipts.map((receipt) => (
            <tr key={receipt.id}>
              <td>{receipt.name}</td>
              <td>{receipt.source}</td>

              <td>{receipt.time}</td>
              <td>{receipt.instructions}</td>
            </tr>
          ))}
          {/* <tr>
            <td>{receiptNodes}</td>
          </tr> */}
        </tbody>
      </table>
    </div>
  );
};

const mapStateToProps = (state) => {
  return {
    receipts: state.receipts.main.receipts,
  };
};

export default connect(mapStateToProps)(ReceiptList);
